// @ts-nocheck
import React, { useState } from 'react';

export default function Hero() {
  const [isLoading, setIsLoading] = useState();

  return (
    <div>
      <p>The Page is {isLoading ? 'Loading' : 'not Loading'}</p>
      <button onClick = {() => setIsLoading(true)}>Turn On Loading</button>
      <button onClick={() => setIsLoading(false)}>Turn Off Loading</button>

    </div>
  );
}
